import React from 'react';
import {useQuery} from "@apollo/react-hooks";
import {query} from '../pages/views/Index';

const Compoent = () => {
    const { loading, error, data, fetchMore, networkStatus } = useQuery(query);
    console.log(loading, error, data, fetchMore, networkStatus);
    return  null
};

export default Compoent;
